{"latex.json":"{
	// Place your snippets for latex here. Each snippet is defined under a snippet name and has a prefix, body and 
	// description. The prefix is what is used to trigger the snippet and the body will be expanded and inserted. Possible variables are:
	// $1, $2 for tab stops, $0 for the final cursor position, and ${1:label}, ${2:another} for placeholders. Placeholders with the 
	// same ids are connected.
	// Example:
	// "Print to console": {
	// 	"prefix": "log",
	// 	"body": [
	// 		"console.log('$1');",
	// 		"$2"
	// 	],
	// 	"description": "Log output to console"
	// }

"Function": {
	"prefix": "fun",
	"body": "f:$1\\R\\to\\R$0",
},



"Subset":{
	"prefix": "cc",
	"body": "\\subset$1eq$0",
},

"Sine":{
	"prefix": "sin",
	"body": "\\sin$0"
},

"Cosine":{
	"prefix": "cos",
	"body": "\\cos$0"
},

"Tangent":{
	"prefix": "tan",
	"body": "\\tan$0"
},

"Cotangent":{
	"prefix": "cot",
	"body": "\\cot$0"
},

"Exponetial":{
	"prefix": "exp",
	"body": "\\exp$0"
},

"Logarithm":{
	"prefix": "log",
	"body": "\\log$0"
},

"Absolute value":{
	"prefix": "abs",
	"body": "\\abs{$1}$0"
},

"Implies":{
	"prefix": "implies",
	"body": "\\implies$0"
},

"If and only if":{
	"prefix": "iff",
	"body": "\\iff$0"
},

"Belongs":{
	"prefix": "in",
	"body": "\\in$0"
},

"set":{
	"prefix": "set",
	"body": "\\left\\{ $1 : $2 \\right\\\\}$0"
},

"Diferencial":{
	"prefix": "dd",
	"body": "\\dd x$0"
},

"Integral": {
	"prefix": "integral",
	"body": [
		"\\int_{${1:a}}^{${2:b}}$3\\dd x $0"
	]
},

"Derivada":{
	"prefix": "derivative",
	"body": "\\frac{\\dd $1}{\\dd $2}$0"
},

"Greater or equal than":{
	"prefix": ">>",
	"body": "\\geq $0"
},

"Matrix":{
	"prefix": "mm",
	"body": [
		"\\matrix{",
		"\t$0;",
		"}"
	]
},

"Augmented Matrix":{
	"prefix": "amm",
	"body": [
		"\\Amatrix{",
		"\t$0;",
		"}"
	]
},

"Augmented n Matrix":{
	"prefix": "amn",
	"body": [
		"\\AAmatrix{",
		"\t$0;",
		"}"
	]
},

"Determinant matrix":{
	"prefix": "dmm",
	"body": [
		"\\Dmatrix{",
		"\t$0;",
		"}"
	]
},

"Math caligraphic":{
	"prefix": "mcal",
	"body": "\\mathcal{$1}$0"
},

"Math slanted":{
	"prefix": "msl",
	"body": "\\mathsl{$1}$0"
},

"Generador":{
	"prefix": "gen",
	"body": "\\gen $0"
},



	"Align*": {
		"prefix": "al",
		"body": [
			"\\begin{align*}",
			"\t$0",
			"\\end{align*}"
		]
	},
	"itemize": {
		"prefix": "itemize",
		"body": [
			"\\begin{itemize}",
			"\t\\item $1",
			"\\end{itemize}",
			"$0"
		]
	},

	"enumerate": {
		"prefix": "enum",
		"body": [
			"\\begin{enumerate}[label=(\\roman$1*)]",
			"\t\\item $0",
			"\\end{enumerate}"
		]
	},

	"Theorem": {
		"prefix": "thm",
		"body": [
			"\\begin{theorem}",
			"\t$0",
			"\\end{theorem}"
		]
	},	

	"Proof": {
		"prefix": "proof",
		"body": [
			"\\begin{proof}",
			"\t$0",
			"\\end{proof}"
		]
	},	

	"Problem": {
		"prefix": "problem",
		"body": [
			"\\begin{problem}",
			"\t$0",
			"\\end{problem}"
		]
	},		

	"Definition": {
		"prefix": "definition",
		"body": [
			"\\begin{definition}",
			"\t$0",
			"\\end{definition}"
		]
	},	

	"Remark": {
		"prefix": "remark",
		"body": [
			"\\begin{remark}",
			"\t$0",
			"\\end{remark}"
		]
	},	

	"Example": {
		"prefix": "example",
		"body": [
			"\\begin{example}",
			"\t$0",
			"\\end{example}"
		]
	},		

	"Problema": {
		"prefix": "problema",
		"body": [
			"\\begin{problema}",
			"\t$0",
			"\\end{problema}"
		]
	},		

	"Frame": {
		"prefix": "frame",
		"body": [
			"\\begin{frame}{$1}",
			"\t$0",
			"\\end{frame}"
		]
	},	


	"Environment": {
		"prefix": "beg",
		"body": [
			"\\begin{${1:name}}",
			"\t$0",
			"\\end{${1:name}}"
		]
	},


	"Image": {
		"prefix": "img",
		"body": [
			"\\begin{figure}[!htb]",
			"\t\\centering",
			"\t\\includegraphics[width=0.5$1\\textwidth]{$2}",
			"\t\\caption{$3}%\\label{fig:$3}",
			"\\end{figure}",
			"$0"
		]
	},

	"pmatrix": {
		"prefix": "pm",
		"body": [
			"\\begin{pmatrix}",
			"$1",
			"\\end{pmatrix}",
			"$0"
		]
	},


	"Sum": {
		"prefix": "sum",
		"body": [
			"\\sum_{${1:i=0}}^{${2:\\infty}} $0"
		]
	},

	"Big_Cup":{
		"prefix": "bcup",
		"body": [
			"\\bigcup_{i\\in I}$0"
		]
	},

	"Big_Cap":{
		"prefix": "bcap",
		"body": [
			"\\bigcap_{i\\in I}$0"
		]
	},

	"Family of sets":{
		"prefix": "fam",
		"body": [
			"\\(\\left( F_\\alpha \\right)_{\\alpha\\in I}\\)$0"
		]
	},

	"Topological space":{
		"prefix": "tops",
		"body": [
			"\\(\\left( X, \\mathscr{T} \\right)\\)$0"
		]
	},

	"Metric space":{
		"prefix": "met",
		"body": [
			"\\(\\left( X, d \\right)\\)$0"
		]
	},

	"Net":{
		"prefix": "net",
		"body": "\\(\\left( x_\\alpha \\right)_{\\alpha\\in D}\\)"
	},

	"Sequence":{
		"prefix": "seq",
		"body": "\\(\\left( x_n \\right)_1^\\infty\\)"
	},	

	"Epsilon":{
		"prefix": "epsilon",
		"body": "\\( \\varepsilon > 0 \\)"
	},		


	"Union": {
		"prefix": "bunion",
		"body": "\\bcup_{\\alpha\\in I} O_\\alpha"
	},


	"For the sake of contradiction" :{
		"prefix": "fsc",
		"body": "for the sake of contradiction"
	},

	"Autoref command" :{
		"prefix": "aref",
		"body": "\\autoref{$1}$0"
	}    

}"}
